--
-- Table structure for table `class`
--

DROP TABLE IF EXISTS `class`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `class` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id，自增',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `class_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '班级编码，2019年新东方优能中学部的班级编码为12位，U6MCFB020001，其中‘u''表示优能中学部，6表示六年级，M学科，C为班型：志高，F为班级规模：25人，B表示季度，’02‘表示曹杨校区，''0001''为序号。所以这里另外加年级，学科等字段，以便后续班级编码规则改变系统更新',
  `class_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '班级名称',
  `class_campus` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '班级所属校区',
  `class_grade` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '班级的年级',
  `class_subject` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '班级所属学科',
  `class_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `class_year` year(4) DEFAULT NULL COMMENT '班级上课学期，如：''2019''',
  `class_season` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '上课季度，暑假，秋季等',
  `class_sub_season` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `class_time` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '班级上课时间，如周日8:00-10:：00',
  `class_simplified_time` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '简化的班级上课时间，如8:00-10:：00',
  `class_times` int(11) DEFAULT NULL COMMENT '班级上课次数，有具体班级情况和学期决定',
  `class_teacher_id` bigint(20) DEFAULT NULL COMMENT '班级任课教师的主键id',
  `class_assistant_id` bigint(20) DEFAULT NULL COMMENT '班级助教的主键id',
  `classroom` varchar(10) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '班级上课教室，如：313',
  `class_teacher_requirement` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '任课教师开课要求',
  `class_remark` varchar(500) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '班级备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `class_id_UNIQUE` (`class_id`) COMMENT '班级编码唯一',
  KEY `c_a_idx` (`class_assistant_id`),
  KEY `c_t_idx` (`class_teacher_id`),
  CONSTRAINT `c_a` FOREIGN KEY (`class_assistant_id`) REFERENCES `assistant` (`id`) ON DELETE SET NULL ON UPDATE RESTRICT,
  CONSTRAINT `c_t` FOREIGN KEY (`class_teacher_id`) REFERENCES `teacher` (`id`) ON DELETE SET NULL ON UPDATE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=528 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
/*!40101 SET character_set_client = @saved_cs_client */;

