INSERT INTO `user_message` VALUES (1,'2019-12-08 09:09:42','2020-01-29 09:05:21',0,0,'AOWS-优能助教在线工作平台正式版上线啦！','AOWS-优能助教在线工作平台正式版上线啦！\n<br>欢迎曹杨和新闸的助教们~你们都是第一批体验“黑科技”的幸运儿！尽情地体验黑魔法的神奇力量吧！','welcome.png','2019-12-08 09:09:42',1,NULL),(104,'2019-12-12 04:44:36','2019-12-17 11:44:51',0,NULL,'常用功能说明','<p>常用功能说明： </p>                                <ul>                                    <li>我的班级信息：左边菜单栏>信息管理>班级信息，点击按钮\"查询我的班级\"。</li>                                    <li>做开班表格：完成1中的操作后，点击表格中的\"开班做表\"，跳转做表页面后，点击输出相应表格即可。</li>                                    <li>学生上课信息：左边菜单栏>信息管理>学员信息>上课信息，可以查询指定学生的上课记录。</li>                                    <li>登录方式之懒癌登录：懒癌登录方式的答案，可以在\"左边菜单栏>懒癌登录问题一览\"查询。你也可以将自己喜欢的问题添加到问题的随机池中！</li>                                    <li>用户角色权限说明：管理员>学管>助教长>助教=教师>游客。可在：用户>个人信息>基本资料，查看自己的角色。通过\"懒癌登录\"的用户角色是游客。</li>                                </ul>   ',NULL,'2019-12-12 04:44:37',1,NULL);
